DashboardDefinitionComponents.Configuration:
{

    "onRowClick": "function(e){if(e.rowType=='data') SkillsWorkflow.genericPreview(e.key.Oid, 'Name', 'document');}",
    "selection": {
        "mode": "multiple"
    },
    "columns": [
        {
            "dataField": "Oid",
            "visible": false
        },
            "Name",
            "InitialSequence",
        {
            "dataField": "NumberFormat",
            "customizeText": "function(cellInfo){
                if(cellInfo.value==0) return 'Year';
                if(cellInfo.value==1) return 'CompanyYear';
                if(cellInfo.value==2) return 'CompanyCode';
                if(cellInfo.value==3) return 'ClientCode';
                if(cellInfo.value==4) return 'ProjectNumberDepartmentCode';
                if(cellInfo.value==5) return 'DeliverableNumber';
                if(cellInfo.value==6) return 'ClientBrandMonthYear';
                if(cellInfo.value==7) return 'None';
                if(cellInfo.value==8) return 'Tender';
                if(cellInfo.value==9) return 'ClientCodeBrandCode';
                if(cellInfo.value==10) return 'DepartmentYear';
                if(cellInfo.value==11) return 'ClientCode3DashSequence6';
                if(cellInfo.value==12) return 'ProjectDashSequence';
                if(cellInfo.value==13) return 'CompanyCode4ProductCode6Sequence';
                if(cellInfo.value==14) return 'CompanyCode4ProductCode5Sequence5';
                if(cellInfo.value==15) return 'ClientCode3Sequence4';
                if(cellInfo.value==16) return 'ProjectSequence3';
                if(cellInfo.value==17) return 'ClientCode3ProductCode5Sequence3';
                if(cellInfo.value==18) return 'ProjectSequence5';
                if(cellInfo.value==19) return 'SwInternalNumber';
            }"
        },
            "FunctionSaveValidation"

    ],
    "onToolbarPreparing": "function(e) { 
        var dataGrid = e.component;  
        e.toolbarOptions.items.unshift({ 
            location: 'after', 
            template: 'toggleHeaderFilterButtonTemplate'
    });


}"
}
